import style from "./About.module.css";

const About = () => {
  return (
    <div>
      <br />
      <br />
      <br />
      <br />
      <br />
      <br />
      <br />
      <br />
      <span className={style.texto}>
        Mi nombre es Ulises Bergesio y esta es mi Proyecto integrador
      </span>
    </div>
  );
};

export default About;
